import React from "react";


const Contact=()=>{
    return(
        <div className="contact">
            <h1>Contact us</h1>
            <div> 
                <h3>AKSHAY PEDNEKAR</h3>
                <h3>Mobile Number:-9152678498</h3>
                <h3>Email-id:- asquarehydro@gmail.com</h3>
            </div>
        </div>


    )
}

export default Contact;
